-- start query 1 in stream 5 using template simple_4ij_2.tpl
SELECT cd_gender,
       cd_marital_status,
       cd_education_status,
       COUNT(inv_item_sk),
       COUNT(ws_item_sk),
       COUNT(cs_item_sk)
FROM   inventory
       RIGHT OUTER JOIN catalog_sales
         ON ( catalog_sales.cs_item_sk = inventory.inv_item_sk )
       INNER JOIN customer_demographics
         ON ( customer_demographics.cd_demo_sk = catalog_sales.cs_ship_cdemo_sk )
       INNER JOIN web_sales
         ON ( web_sales.ws_ship_cdemo_sk = catalog_sales.cs_ship_cdemo_sk )
       INNER JOIN customer
         ON ( customer.c_customer_sk = catalog_sales.cs_ship_customer_sk )
       INNER JOIN date_dim
         ON ( date_dim.d_date_sk = customer.c_first_sales_date_sk )
WHERE  ( d_year <= 2000 )
       AND ( c_birth_day <= 9 )
       AND ( ws_list_price < 169 )
GROUP  BY cd_gender,
          cd_marital_status,
          cd_education_status;

