-- @name f_query22.query_tpl_0
-- start query 1 in stream 0 using template query22.tpl
SELECT c_last_name,
       c_first_name,
       ss_ticket_number,
       cnt
FROM   (SELECT ss_ticket_number,
               ss_customer_sk,
               COUNT(*) cnt
        FROM   store_sales,
               date_dim,
               store,
               household_demographics
        WHERE  store_sales.ss_sold_date_sk = date_dim.d_date_sk
               AND store_sales.ss_store_sk = store.s_store_sk
               AND store_sales.ss_hdemo_sk = household_demographics.hd_demo_sk
               AND date_dim.d_dom BETWEEN 1 AND 5
               AND date_dim.d_year IN ( 1999, 1999 + 1, 1999 + 2 )
               AND store.s_city IN ( 'Fairview', 'Midway', 'Midway', 'Fairview',
                                     'Fairview', 'Fairview' )
               AND ( household_demographics.hd_buy_potential LIKE '501-1000%'
                      OR household_demographics.hd_buy_potential LIKE '0-500%' )
        GROUP  BY ss_ticket_number,
                  ss_customer_sk) mp,
       customer
WHERE  ss_customer_sk = c_customer_sk
       AND cnt BETWEEN 1 AND 5
ORDER  BY cnt DESC;

-- end query 1 in stream 0 using template query22.tpl
-- @name f_query25.query_tpl_10
-- start query 1 in stream 10 using template query25.tpl
SELECT i_item_id,
       i_item_desc,
       s_store_id,
       s_store_name,
       SUM(ss_net_profit) AS store_sales_profit,
       SUM(sr_net_loss)   AS store_returns_loss,
       SUM(cs_net_profit) AS catalog_sales_profit
FROM   store_sales,
       store_returns,
       catalog_sales,
       date_dim d1,
       date_dim d2,
       date_dim d3,
       store,
       item
WHERE  d1.d_moy = 4
       AND d1.d_year = 1999
       AND d1.d_date_sk = ss_sold_date_sk
       AND i_item_sk = ss_item_sk
       AND s_store_sk = ss_store_sk
       AND ss_customer_sk = sr_customer_sk
       AND ss_item_sk = sr_item_sk
       AND ss_ticket_number = sr_ticket_number
       AND sr_returned_date_sk = d2.d_date_sk
       AND d2.d_moy BETWEEN 4 AND 4 + 6
       AND d2.d_year = 1999
       AND sr_customer_sk = cs_bill_customer_sk
       AND sr_item_sk = cs_item_sk
       AND cs_sold_date_sk = d3.d_date_sk
       AND d3.d_moy BETWEEN 4 AND 4 + 6
       AND d3.d_year = 1999
GROUP  BY i_item_id,
          i_item_desc,
          s_store_id,
          s_store_name
ORDER  BY i_item_id,
          i_item_desc,
          s_store_id,
          s_store_name;

