-- @name f_query67.query_tpl_13
-- start query 1 in stream 13 using template query67.tpl
SELECT s_state,
       i_item_id,
       SUM(CASE
             WHEN ( CAST(d_date AS DATE) < CAST('1999-10-27' AS DATE) ) THEN ss_net_paid - COALESCE(sr_net_loss, 0)
             ELSE 0
           END) AS sales_before,
       SUM(CASE
             WHEN ( CAST(d_date AS DATE) >= CAST('1999-10-27' AS DATE) ) THEN ss_net_paid - COALESCE(sr_net_loss, 0)
             ELSE 0
           END) AS sales_after
FROM   store_sales
       LEFT OUTER JOIN store_returns
         ON ( ss_ticket_number = sr_ticket_number
              AND ss_item_sk = sr_item_sk ),
       store,
       item,
       date_dim
WHERE  i_rec_start_date = CAST('1999-10-27' AS DATE)
       AND i_item_sk = ss_item_sk
       AND ss_store_sk = s_store_sk
       AND ss_sold_date_sk = d_date_sk
       AND d_date BETWEEN ( CAST('1999-10-27' AS DATE) - 90 ) AND ( CAST('1999-10-27' AS DATE) + 90 )
GROUP  BY s_state,
          i_item_id;

