-- start query 1 in stream 5 using template query75.tpl
SELECT i_item_id,
       i_item_desc,
       i_current_price
FROM   item,
       inventory,
       date_dim
WHERE  i_current_price BETWEEN 3 AND 3 + 30
       AND inv_item_sk = i_item_sk
       AND d_date_sk = inv_date_sk
       AND d_date BETWEEN CAST('2001-04-10' AS DATE) AND ( CAST('2001-04-10' AS DATE) + 60 )
       AND i_manufact_id IN ( 695, 401, 838, 725 )
       AND inv_quantity_on_hand BETWEEN 100 AND 500
GROUP  BY i_item_id,
          i_item_desc,
          i_current_price
ORDER  BY i_item_id;

